import React from 'react';
import './Footer.css';

// <!-- 頁尾區 -->
function Footer() {
    return (
  <footer>
    <nav>
      <ul className="menu">
        <li><a href="/">關於我們<br />About us</a></li>
        <li><a href="/">麩質教室<br />About gluten</a></li>
        <li><a href="/">購買管道<br />Purchase</a></li>
        <li><a href="/">食譜分享<br />Recipe</a></li>
        <li><a href="/">無麩友社群<br />Community</a></li>

      </ul>

      <ul className="icon">
        <li><a href="/" className="btn_fb"></a></li>
        <li><a href="/" className="btn_ig"></a></li>
        <li><a href="#" className="btn_line"></a></li>
      </ul>
    </nav>
    <small>@ Hostry 版權所有</small>

    {/* <!-- 置頂按鈕 --> */}
    <div id="gotop"><i className="fa-solid fa-angle-up"></i></div>
  </footer>
  );
}


export default Footer;
